import "../styles/menu.css";
import appLogo from "../assets/images/amazon-logo.png"
export default function Menu() {

    return (
        <div className="menu">
        <img src={appLogo} alt="Logo" className="logo"/>

        <form className="formulaire">
            <input type="text" className="form-control mx-3" placeholder="Que chercher vous ?"/>
            <button type="submit" className="btn btn-info mx-3">
            Recherche
            </button>
        </form>
        </div>
    );
}
